import { Box } from "@mui/material";
import { themes } from "../../../config/icons";

const body = () =>{

    const themeMode = themes.light

    return (
        <Box
            display="flex"
            padding="0px 8px"
            sx={{alignContent:"center"}}       
        >
            <Box padding="0px 8px">
                <Box component={"img"} src={themeMode.imagen.imgnovia} sx={{width:"100%", ali}}/>
            </Box>
            <Box padding="0px 8px">
                <Box component={"img"} src={themeMode.imagen.imgnadando}/>
            </Box>
        </Box>
    );
}

export default body;
